import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function CreateUser() {
    const [name, setName] = useState("");
    const [lastname, setLastname] = useState("");
    const [cost, setCost] = useState("");
    const [shipment, setShipment] = useState("");
    const [AdressCustomer, setAdressCustomer] = useState("");
    const [message, setMessage] = useState("");
    const [CustomerPhoneNumber, setCustomerPhoneNumber] = useState("");
    const navigate = useNavigate();

    const handleSubmit = async (e) => {
        e.preventDefault();

        // เช็คว่าได้กรอกข้อมูลครบทุกช่องแล้ว
        if (!name || !lastname || !cost || !shipment || !AdressCustomer || !CustomerPhoneNumber) {
            setMessage("Please fill in all fields.");
            console.log("Form Data:", { name, lastname, cost, shipment, AdressCustomer, CustomerPhoneNumber });
            return;
        }

        // ตรวจสอบให้มั่นใจว่า cost เป็นตัวเลข
        if (isNaN(cost) || cost === "") {
            setMessage("Cost must be numeric values.");
            return;
        }

        // ตรวจสอบเบอร์โทรศัพท์ให้มีความยาว 10 ตัว
        if (CustomerPhoneNumber.length !== 10) {
            setMessage("Phone number must be 10 digits.");
            return;
        }

        try {
            // ส่งข้อมูลไปที่ API
            const response = await axios.post("http://localhost:5000/create-user", { 
                name, 
                lastname, 
                cost: parseFloat(cost),
                shipment, 
                AdressCustomer,
                CustomerPhoneNumber 
            });

            navigate('/'); // redirect ไปที่หน้า Home
        } catch (error) {
            setMessage(error.response?.data?.message || "Error creating user, please try again.");
            console.log("Error Response:", error.response?.data || error.message);
        }
    }

    return (
        <div className="container">
            <h1>Create User</h1>
            {message && <p className="text-danger">{message}</p>}

            <form onSubmit={handleSubmit}>
                <div className="mb-3 w-25">
                    <label className="form-label">Name:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                        required
                    />
                </div>

                <div className="mb-3 w-25">
                    <label className="form-label">Lastname:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={lastname}
                        onChange={(e) => setLastname(e.target.value)}
                        required
                    />
                </div>
                <div className="w-25 mb-3">
                    <label className="form-label">AdressCustomer:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={AdressCustomer}
                        onChange={(e) => setAdressCustomer(e.target.value)}
                        required
                    />
                </div>

                <div className="w-25 mb-3">
                    <label className="form-label">CustomerPhoneNumber:</label>
                    <input
                        type="tel"
                        className="form-control"
                        value={CustomerPhoneNumber}
                        onChange={(e) => setCustomerPhoneNumber(e.target.value)}
                        required
                    />
                </div>

                <div className="mb-3 w-25">
                    <label className="form-label">Cost:</label>
                    <input
                        type="number"
                        className="form-control"
                        value={cost}
                        onChange={(e) => setCost(e.target.value)}
                        required
                    />
                </div>

                <div className="w-25 mb-3">
                    <label className="form-label">Shipment:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={shipment}
                        onChange={(e) => setShipment(e.target.value)}
                        required
                    />
                </div>

                <div className="mb-3">
                    <button type="submit" className="btn btn-success">Submit</button>
                </div>
            </form>
        </div>
    );
}

export default CreateUser;
